// Initialize gallery
function initializeGallery() {
    showAlbumsView();
}

// Show albums view
function showAlbumsView() {
    currentView = 'albums';
    currentAlbum = null;
    
    document.getElementById('albumView').style.display = 'block';
    document.getElementById('imageView').classList.remove('show');
    document.getElementById('backBtn').classList.remove('show');
    document.getElementById('addAlbumBtn').style.display = 'block';
    document.getElementById('blurControls').style.display = 'none';
    
    document.getElementById('pageTitle').textContent = 'Photo Albums';
    document.getElementById('pageSubtitle').textContent = 'Discover curated collections of stunning photography';
    document.getElementById('searchInput').placeholder = 'Search albums...';

    renderAlbums();
}

// Show specific album
function showAlbum(albumId) {
    currentView = 'images';
    currentAlbum = albumsData[albumId];
    
    if (!currentAlbum) return;

    document.getElementById('albumView').style.display = 'none';
    document.getElementById('imageView').classList.add('show');
    document.getElementById('backBtn').classList.add('show');
    document.getElementById('addAlbumBtn').style.display = 'none';
    document.getElementById('blurControls').style.display = 'flex';
    
    document.getElementById('pageTitle').textContent = currentAlbum.title;
    document.getElementById('pageSubtitle').textContent = currentAlbum.description;
    document.getElementById('searchInput').placeholder = 'Search images...';

    renderImages();
}

// Render albums
function renderAlbums() {
    const albumGrid = document.getElementById('albumGrid');
    albumGrid.innerHTML = '';

    Object.values(albumsData).forEach(album => {
        const albumCard = document.createElement('div');
        albumCard.className = 'album-card';
        albumCard.onclick = () => showAlbum(album.id);
        
        albumCard.innerHTML = `
            <div class="album-cover">
                <img src="${album.cover}" alt="${album.title}" loading="lazy">
            </div>
            <div class="album-info">
                <h3 class="album-title">${album.title}</h3>
                <p class="album-description">${album.description}</p>
                <div class="album-stats">
                    <span class="album-count">${album.images.length} photos</span>
                    <span>Click to explore</span>
                </div>
            </div>
        `;
        
        albumGrid.appendChild(albumCard);
    });
}

// Render images
function renderImages() {
    if (!currentAlbum) return;

    const imageGrid = document.getElementById('imageGrid');
    imageGrid.innerHTML = '';

    currentAlbum.images.forEach((image, index) => {
        const imageItem = document.createElement('div');
        imageItem.className = 'image-item';
        if (isBlurred) imageItem.classList.add('blurred');
        
        imageItem.onclick = () => openLightbox(image.src, image.title);
        
        imageItem.innerHTML = `
            <img src="${image.src}" alt="${image.title}" loading="lazy">
            <div class="image-overlay">
                <div class="image-description">${image.description}</div>
            </div>
        `;
        
        imageGrid.appendChild(imageItem);
    });
}

// Filter content based on current view
function filterContent() {
    const searchTerm = document.getElementById('searchInput').value.toLowerCase();
    
    if (currentView === 'albums') {
        filterAlbums(searchTerm);
    } else {
        filterImages(searchTerm);
    }
}

// Filter albums
function filterAlbums(searchTerm) {
    const albumCards = document.querySelectorAll('.album-card');
    const noResults = document.getElementById('noResults');
    let visibleCount = 0;

    albumCards.forEach(card => {
        const title = card.querySelector('.album-title').textContent.toLowerCase();
        const description = card.querySelector('.album-description').textContent.toLowerCase();
        const shouldShow = searchTerm === '' || title.includes(searchTerm) || description.includes(searchTerm);

        if (shouldShow) {
            card.classList.remove('hidden');
            visibleCount++;
        } else {
            card.classList.add('hidden');
        }
    });

    noResults.style.display = visibleCount === 0 ? 'block' : 'none';
}

// Filter images
function filterImages(searchTerm) {
    const imageItems = document.querySelectorAll('.image-item');
    const noResults = document.getElementById('noImageResults');
    let visibleCount = 0;

    imageItems.forEach(item => {
        const title = item.querySelector('.image-title').textContent.toLowerCase();
        const description = item.querySelector('.image-description').textContent.toLowerCase();
        const shouldShow = searchTerm === '' || title.includes(searchTerm) || description.includes(searchTerm);

        if (shouldShow) {
            item.classList.remove('hidden');
            visibleCount++;
        } else {
            item.classList.add('hidden');
        }
    });

    noResults.style.display = visibleCount === 0 ? 'block' : 'none';
}

// Go back to albums
function goBack() {
    showAlbumsView();
}

// Toggle blur
function toggleBlur() {
    const toggle = document.getElementById('blurToggle');
    isBlurred = !isBlurred;
    
    if (isBlurred) {
        toggle.classList.add('active');
    } else {
        toggle.classList.remove('active');
    }

    const imageItems = document.querySelectorAll('.image-item');
    imageItems.forEach(item => {
        if (isBlurred) {
            item.classList.add('blurred');
        } else {
            item.classList.remove('blurred');
        }
    });
}

// Lightbox functions
function openLightbox(src, title) {
    const lightbox = document.getElementById('lightbox');
    const lightboxImage = document.getElementById('lightboxImage');
    
    lightboxImage.src = src;
    lightboxImage.alt = title;
    lightbox.classList.add('show');
    
    // Prevent body scroll
    document.body.style.overflow = 'hidden';
}

function closeLightbox() {
    const lightbox = document.getElementById('lightbox');
    lightbox.classList.remove('show');
    
    // Restore body scroll
    document.body.style.overflow = 'auto';
}

// Upload functionality
let currentAlbumForUpload = null;
let filesToUpload = [];

// Add new album prompt
function showAddAlbumPrompt() {
    const albumName = prompt('Enter album name:');
    if (albumName) {
        const albumDescription = prompt('Enter album description:') || 'A new photo collection.';
        addNewAlbum(albumName, albumDescription);
    }
}

// Add new album
function addNewAlbum(name, description) {
    const albumId = name.toLowerCase().replace(/\s+/g, '_').replace(/[^a-z0-9_]/g, '');
    
    albumsData[albumId] = {
        id: albumId,
        title: name,
        description: description,
        cover: 'https://images.unsplash.com/photo-1472214103451-9374bd1c798e?w=400', // Default cover
        images: []
    };
    
    renderAlbums();
    showUploadModal(name);
}

// Upload Modal Functions
function showUploadModal(albumName) {
    currentAlbumForUpload = albumName;
    filesToUpload = [];
    const modal = document.getElementById('uploadModal');
    const preview = document.getElementById('uploadPreview');
    const progress = document.getElementById('uploadProgress');
    
    modal.classList.add('show');
    preview.innerHTML = '';
    progress.style.display = 'none';
    
    // Setup drag and drop
    const dropZone = document.getElementById('uploadZone');
    dropZone.onclick = () => document.getElementById('fileInput').click();
    
    dropZone.ondragover = (e) => {
        e.preventDefault();
        dropZone.classList.add('dragover');
    };
    
    dropZone.ondragleave = () => dropZone.classList.remove('dragover');
    
    dropZone.ondrop = (e) => {
        e.preventDefault();
        dropZone.classList.remove('dragover');
        handleFiles(e.dataTransfer.files);
    };
    
    document.getElementById('fileInput').onchange = (e) => handleFiles(e.target.files);
}

function closeUploadModal() {
    document.getElementById('uploadModal').classList.remove('show');
    currentAlbumForUpload = null;
    filesToUpload = [];
}

function handleFiles(files) {
    const preview = document.getElementById('uploadPreview');
    
    Array.from(files).forEach(file => {
        if (!file.type.startsWith('image/')) return;
        
        const reader = new FileReader();
        const previewItem = document.createElement('div');
        previewItem.className = 'preview-item';
        
        reader.onload = (e) => {
            previewItem.innerHTML = `
                <img src="${e.target.result}" alt="${file.name}">
                <button class="preview-remove" onclick="removeFile('${file.name}')">&times;</button>
            `;
        };
        
        reader.readAsDataURL(file);
        preview.appendChild(previewItem);
        filesToUpload.push(file);
    });
    
    document.getElementById('uploadButton').disabled = filesToUpload.length === 0;
}

function removeFile(fileName) {
    filesToUpload = filesToUpload.filter(f => f.name !== fileName);
    updatePreview();
}

function updatePreview() {
    const preview = document.getElementById('uploadPreview');
    preview.innerHTML = '';
    
    filesToUpload.forEach(file => {
        const reader = new FileReader();
        const previewItem = document.createElement('div');
        previewItem.className = 'preview-item';
        
        reader.onload = (e) => {
            previewItem.innerHTML = `
                <img src="${e.target.result}" alt="${file.name}">
                <button class="preview-remove" onclick="removeFile('${file.name}')">&times;</button>
            `;
        };
        
        reader.readAsDataURL(file);
        preview.appendChild(previewItem);
    });
    
    document.getElementById('uploadButton').disabled = filesToUpload.length === 0;
}

async function uploadFiles() {
    if (!currentAlbumForUpload || filesToUpload.length === 0) return;
    
    const progress = document.getElementById('uploadProgress');
    const progressBar = document.createElement('div');
    progressBar.className = 'progress-bar';
    progress.innerHTML = '';
    progress.appendChild(progressBar);
    progress.style.display = 'block';
    
    const formData = new FormData();
    formData.append('album', currentAlbumForUpload);
    filesToUpload.forEach(file => formData.append('files[]', file));
    
    try {
        const response = await fetch('http://localhost:8000/upload', {
            method: 'POST',
            body: formData
        });
        
        if (response.ok) {
            const result = await response.json();
            if (result.status === 'success') {
                alert('Images uploaded successfully!');
                closeUploadModal();
                // Reload the page to show new images
                window.location.reload();
            } else {
                alert('Upload failed: ' + result.message);
            }
        } else {
            alert('Upload failed. Please try again.');
        }
    } catch (error) {
        alert('Upload failed: ' + error.message);
    }
}

